// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
contract CampaignNFT is Ownable, ERC721URIStorage{
    uint public current;
    uint public price;
    uint public slot;
    bool public ended;
    uint public tokenId;

    struct Donor {
        address wallet;
        uint amount;
    }
    struct Donee {
        address wallet;
        uint amount;
    }
    uint public donorsCount;
    uint public doneesCount;
    mapping(uint => Donee) public donees;
    mapping(uint => Donor) public donors;

    mapping(address => uint) public donorToId;
    mapping(address => uint) public doneeToId;
    mapping(string => bool) public usedURI;

    event minted(address donor);
    event donated(address donor);
    event distributed(address donee, uint amount);



    constructor (address _creator, string memory _name,uint _slot, uint _price) ERC721(_name, _name) Ownable() {
        slot = _slot;
        price = _price;
        current = 0;
        ended = false;
        transferOwnership(_creator);
    }



    function isDonor() external returns(bool) {
        return (donorToId[msg.sender]!=0);
    }
    function isDonee() external returns(bool) {
        return (doneeToId[msg.sender]!=0);
    }

    function mint(string memory _tokenURI)  payable external{
        require(msg.value >= price, "Not enough price");
        require(ended==false, "Campaign is closed");
        require(slot > 0, "Campaign has no nft slot");
        require(usedURI[_tokenURI]==false, "TokenURI is already taken");

        current += msg.value;

        if(donorToId[msg.sender]!=0){
            donors[donorToId[msg.sender]].amount += msg.value;
        } else{
            donorsCount += 1;
            donors[donorsCount] = Donor(msg.sender, msg.value);
            donorToId[msg.sender] = donorsCount;    
        }


        _safeMint(msg.sender, tokenId);
        _setTokenURI(tokenId, _tokenURI);
        tokenId += 1;
        slot -= 1;
        emit minted(msg.sender);

    }
    function donate() payable external {
        require(msg.value >= price, "Not enough price");
        require(ended==false, "Campaign is closed");

        current += msg.value;


        if(donorToId[msg.sender]!=0){
            donors[donorToId[msg.sender]].amount += msg.value;
        } else{
            donorsCount += 1;
            donors[donorsCount] = Donor(msg.sender, msg.value);
            donorToId[msg.sender] = donorsCount;    
        }

        emit donated(msg.sender);
    }
    function applyToDonee() external {
        require(ended==false, "Campaign is closed");
        require(doneeToId[msg.sender]==0, "This address already applied for this campaign");

        doneesCount += 1;
        donees[doneesCount] = Donee(msg.sender, 0);
        doneeToId[msg.sender] = doneesCount;
    }
    function distribute(uint _doneeId, uint _amount) public onlyOwner {
        require(ended, "Campaign is not closed yet");
        require(_amount <= current, "Campaign out of token");

        address payable doneeAddress = payable(donees[_doneeId].wallet);

        doneeAddress.transfer(_amount);

        current -= _amount;
        donees[_doneeId].amount += _amount;

        emit distributed(doneeAddress, _amount);
    }

    function end() public onlyOwner {
        require(ended==false, "Campaign has already been closed");
        ended = true; 
    }
    function open() public onlyOwner {
        require(ended==true, "Campaign has already been active");
        ended = false;
    }
}
